import React from 'react'
import Card from './Card'
export function CardDeck(props) {

    return (
        <div> 
            <div className="city-lights" style={{backgroundImage: "https://i.pinimg.com/originals/fb/58/54/fb58546e0b6e6e14ec4a1bf154dfe738.jpg"}}> </div>  
            <div className="card-deck">
                {props.cardData.map(
                    card => <Card cardData={card} 
                    clickAction={props.onCardClick}
                    checkCards={props.checkCards}
                    matched={props.matched}
                    key={card.id}
                    />
                )}     
            </div>

        </div>
    )
}

export default CardDeck;
